Este soneto titulado "Amor cautivo" fue escrito por Manuel José Quintana (1772-1857), poeta español del periodo neoclásico que también se adentró en el romanticismo. El tema del amor y la figura mitológica de Cupido (Amor) son característicos de su obra lírica.
